const main = (event) => {
const eyes = document.querySelectorAll('.cls-16');
// const flowers = document.querySelectorAll('.cls-187');
const selector = (query,context = document) => [].slice.call( 
  context.querySelectorAll(query)
)

// const pipe = (funcs) => input => funcs.reduce( (acc,item) => item(acc), input )

const fSelector = (context) => query => selector(query,context)
const flatten = multiList => multiList.reduce( (acc,item) => acc.concat(item), [] )
const selectMultiple = context => (...queries) => flatten(queries.map(
  fSelector(context) 
))


const add = (a,b,c) => a + b +c 
const curriedAdd = a => b => c => add(a,b,c)
const curry = (fn,...args) => args.length >= fn.length 
  ? fn(...args)
  : curry.bind(null,fn,...args)


const selectMultiFromDocument = selectMultiple(document)
const flowers = selectMultiFromDocument( '.cls-186', '.cls-186' )
const peak = selectMultiFromDocument('.cls-182', '.cls-188');
const clouds = selector('g#clouds');
console.log(clouds);


const flowersArray = selector('.cls-186');
const yellowFlowersArray = selector('.cls-187');
// const flowers = $selector('.cls-186', '.cls-187');
// console.log(flowers);

function clearStage() {
  var clearTl = new TimelineMax();

  clearTl
  .set(flowersArray, {autoAlpha: 0})
  .set(yellowFlowersArray, {autoAlpha: 0})
  .set(clouds, {left:-100, opacity:0});


  return clearTl;
  }

  function enterFloorVegetation() {
    const enterFloorVegetationTl = new TimelineMax();
          enterFloorVegetationTl
          .fromTo(flowersArray, 1, {autoAlpha:0, scaleY:0.2, transformOrigin: 'center center'}, {autoAlpha:1, scaleY:1, transformOrigin: 'center center', ease: Back.easeInOut, onComplete: startBlinking})
          .fromTo(yellowFlowersArray, 1, {autoAlpha:0, scaleX:0.2, transformOrigin: 'center center'}, {autoAlpha:1, scaleX:1, transformOrigin: 'center center', ease: Back.easeInOut}, "-=0.9")




          return enterFloorVegetationTl;
  }

const remove = count => start => arr => {
  // create a copy of the original array
  // now you're not fucking with the original when you
  // mutate the shit out of the data
  const arrCopy = arr.slice()

  // NOW MUTATE THIS BITCH
  const thisisWhatIsSpliceOut = arrCopy.splice(start,count)

  // this now no longer has the spliced out item, we want this
  const whatRemains = arrCopy

  // This seems confusing because arrCopy is mutated by
  // the dangerous mutating function splcie
  return [ thisisWhatIsSpliceOut, whatRemains ]
}

const remove1 = remove(1)
// Not pure
const remove1RandomItem = arr => remove1(Math.floor(Math.random() * arr.length))(arr)
// Not pure
const shuffle = arr => {
  let tempArr = arr 
  let removedItem
  return arr.reduce( (acc,item) => ( [removedItem,tempArr] = remove1RandomItem(tempArr), acc.concat(removedItem)  ) , [])
}


const flowerDance = () => {
  const removeFirstItems = (arr,count) => remove( count )( 0 )( shuffle(flatten(arr)) )


  const [removeItems1,leftOver1] = removeFirstItems( flowers, 10 )
  const [removeItems2,leftOver2] = removeFirstItems( leftOver1, 50 )


  return new TimelineMax({repeat:-1, repeatDelay: 1})
  .to(removeItems1, 2, {throwProps:{rotation:360}})
  // .to(removeItems1, 1, {y:0, rotation:32, x:'-=1'}, 0)
  .to(removeItems2, 2, {throwProps:{rotation:360}})
  // .to(removeItems2, 1, {y:0, rotation:32, x:'+=1'}, '-=0.2')

}

