  var birdsEatingTl = new TimelineMax({repeat:-1, repeatDelay: 4});
  birdsEatingTl
  // .set(peak, {rotation:12})
  // .set(peak, { rotation: 0})
  .to(peak, 1.4, {y:'+=3'}, '+=0.1')
  .to(peak, 1.4, {y:'-=3'}, '+=0.1')

  return birdsEatingTl;
}


